import React from 'react';
import { BrowseRouter as Router, Switch, Route } from 'react-router-dom';

import './App.css';
import Navbar from './components/layout/Navbar';

const App = () => {
  return (
    <Router>
      <div className='App'>
        <Navbar />
      </div>
    </Router>
  );
};

export default App;
